const Experience = ( {exp} ) => {
    return (
        <div>
            <h3>{exp.company}</h3>
            <h3>{exp.role}</h3>
            <h4>{exp.date}</h4>
            <p>{exp.description}</p>
        </div>
    )
}

export default Experience
